import React from 'react';
import Online, { Offline } from './OnlineOfflineMethodData';

const NewOffline = Offline.map(item => {
    return (<>
        <div className="col-md-4 col-12">
            <div className="card border-0">
                <img src={item.imgSrc} alt={item.title} className="card-img-top" />
                <div className="card-body text-center">
                    <h6><span className="display-6">{item.id}.</span> {item.title}</h6>
                    <p>{item.details}</p>
                </div>
            </div>
        </div>
    </>)
})

const JEFCardBodyTabContent = () => {
    return (<>
        <div className="tab-content">
            <div className="tab-pane fade" id="offline">
                <div className="row my-5">
                    {NewOffline}
                </div>
            </div>
        </div>
    </>);
}

export default JEFCardBodyTabContent;
